import React from "react";
import Header from './Header'
import {Schwifty} from './Styles/Styles'

export const WelcomePage = () => {
  return (
    <section className="welcome-page">
      <Header /> <br />
      <header>
          <Schwifty>GET SCHWIFTY!</Schwifty>
        <img
          className="main-img ui centered medium circular image"
          src="Sprint-Challenge-Single-Page-Apps/src/components/Images/rick_s_ship_by_mrgrieves21-dbiezzq.png"
          alt="rick"
        />

      </header>
    </section>
  );
}
